def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    ratios = item / bins
    priorities = []

    for ratio in ratios:
        if ratio < 0.3:
            priority = ratio ** 2 + np.sqrt(ratio) - np.cbrt(ratio)
        elif ratio >= 0.3 and ratio < 0.6:
            priority = np.cos(3*ratio) * np.tan(2*ratio) + np.sin(4*ratio)
        elif ratio >= 0.6 and ratio < 0.9:
            priority = np.exp(ratio) * np.log(ratio) + np.sqrt(2*ratio)
        else:
            priority = np.cosh(ratio) * np.sinh(ratio) - np.tanh(ratio) + np.arcsin(ratio)

        priorities.append(priority)

    return np.array(priorities)
